import TaskLists from "./TaskLists";



const SideBar = ({ taskLists, getTaskList, taskCount,setModal }) => {

  const allTasks = taskLists.map((list) => {
    return (
      <TaskLists
        id={list.id}
        name={list.name}
        getTaskList={getTaskList}
        taskCount={taskCount}
      />
    );
  });

  return (
   <div></div>
  );
};

export default SideBar;
